import React, { useState } from 'react';
import { DndProvider, useDrag, useDrop } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';

const LOGIC_BLOCKS = [
  { label: 'Smart Buys in 10m', type: 'smart-buys' },
  { label: 'Volume Spike > X%', type: 'volume-spike' },
  { label: 'Exclude Exit Liquidity', type: 'exclude-exit' },
  { label: 'GambleFi Tag', type: 'narrative' },
];

function LogicBlock({ label, type }) {
  const [, drag] = useDrag(() => ({
    type: 'block',
    item: { type, label },
  }), [type, label]);
  return (
    <div ref={drag} className="bg-neutral-800 rounded-md px-4 py-2 mb-2 cursor-move hover:bg-neutral-700 transition">
      {label}
    </div>
  );
}

function StrategyCanvas({ onDrop, logicBlocks }) {
  const [{ isOver }, drop] = useDrop(() => ({
    accept: 'block',
    drop: (item) => onDrop(item),
    collect: (monitor) => ({
      isOver: monitor.isOver(),
    }),
  }), [onDrop]);
  return (
    <div
      ref={drop}
      className={`min-h-[200px] bg-neutral-900 rounded-lg p-4 text-center border transition-all duration-200 ${isOver ? 'border-2 border-green-400' : 'border border-white/10'}`}
    >
      {logicBlocks.length === 0
        ? (isOver ? 'Drop to Add Block' : '[Drag blocks here]')
        : (
          <div className="flex flex-wrap gap-2 justify-center">
            {logicBlocks.map((b, i) => (
              <span key={i} className="bg-green-900/60 text-green-200 px-3 py-1 rounded font-semibold text-sm">
                {b.label}
                {i < logicBlocks.length - 1 && <span className="text-green-400 mx-2">AND</span>}
              </span>
            ))}
          </div>
        )}
    </div>
  );
}

const previewMatches = [
  { name: 'PAWPAW', risk: 'Low', meta: 'GambleFi', roi: '24%' },
  { name: 'BABY BOB', risk: 'Low', meta: 'GambleFi', roi: '34%' },
];

export default function CreateTab() {
  const [logicBlocks, setLogicBlocks] = useState([]);
  const handleDrop = (block) => setLogicBlocks((prev) => [...prev, block]);

  return (
    <DndProvider backend={HTML5Backend}>
      <div className="flex justify-center gap-8 px-6 md:px-12 py-16 bg-[#0a0a0a] min-h-screen text-white font-sans">
        {/* Logic Blocks Panel */}
        <div className="w-1/4 bg-black/40 rounded-2xl p-6 shadow-md border border-white/10">
          <h2 className="text-xl font-bold mb-4">Logic Blocks</h2>
          {LOGIC_BLOCKS.map((block) => (
            <LogicBlock key={block.type} {...block} />
          ))}
        </div>
        {/* Strategy Canvas */}
        <div className="w-1/3 bg-black/40 rounded-2xl p-6 shadow-md border border-white/10 flex flex-col items-center">
          <h2 className="text-xl font-bold mb-4 text-center">Strategy Flow Canvas</h2>
          <StrategyCanvas onDrop={handleDrop} logicBlocks={logicBlocks} />
          <div className="mt-4 text-sm text-white/70">
            {logicBlocks.length > 0 && logicBlocks.map((b, i) => (
              <span key={i}>
                {b.label} {i < logicBlocks.length - 1 ? <span className="text-green-500 mx-1">AND</span> : ''}
              </span>
            ))}
          </div>
        </div>
        {/* Live Preview */}
        <div className="w-1/3 bg-black/40 rounded-2xl p-6 shadow-md border border-white/10">
          <h2 className="text-xl font-bold mb-4 text-center">Live Token Preview</h2>
          <div className="space-y-2">
            {previewMatches.map((t) => (
              <div key={t.name} className="bg-neutral-800 p-3 rounded-md flex justify-between items-center">
                <div>
                  <div className="text-white font-semibold">{t.name}</div>
                  <div className="text-xs text-white/50">Risk: {t.risk} â€¢ Meta: {t.meta}</div>
                </div>
                <div className="text-green-400 font-semibold">{t.roi}</div>
              </div>
            ))}
          </div>
        </div>
      </div>
      <div className="mt-8 flex justify-center gap-4">
        <button className="px-6 py-2 rounded-lg bg-blue-600 hover:bg-blue-500 transition">Save Draft</button>
        <button className="px-6 py-2 rounded-lg bg-green-500 hover:bg-green-400 transition">Publish Flow</button>
      </div>
    </DndProvider>
  );
}
